import React from 'react';

const Partner = ({data}) => {
    return (
        <div className="info_part_cont_shadow">
            <div className="info_part_elem">
                <div className="info_part_img">
                    <img src={data[1]}/>
                </div>
                <div className="info_part_name">{data[0]}</div>
            </div>
        </div>
    );
};

export default Partner;
